
public class sampletest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
   
		//40 42 44 46-----           80
		// 10  16                   50   
		
		int i = 10;
		while(i<=50) {
			System.out.print(i+" ");
			i+=6;
		}
		System.out.println();
		//  8 16               80
		
		int k=8;
		do {
			System.out.print(k+" ");
			k+=8;
		}while(k<=80);
		
		System.out.println();
		//12 24  36 48 60 72 84 96 108 120
		
		
		int b=12;
		do {
			System.out.println(b);
			b+=12;
		}while(b<=120);
		
		
	}

}
